<script type="text/html" id="tpl_popup">

	<table id="info_content" class="vis" style="background-color: #e5d7b2; width:auto">
<% if (special == 'ghost') { %>
	<tr>
		<th colspan="2">Local para o convidado</th>
	</tr>
	<tr>
		<td colspan="2">Convide um amigo para a tribo!</td>
	</tr>
<% } else { %>
<% if (bonus) { %>
	<tr id="info_bonus_image_row" >
		<td id="info_bonus_image" rowspan="14"><img src="<%= bonus.img %>" /></td>
	</tr>
<% } /* end bonus */ %>

	<tr>
		<th colspan="2"><%== '%name% (%x%|%y%) K%continent%' %></th>
	</tr>


<% if (bonus) { %>
	<tr id="info_bonus_text_row">
		<td colspan="2"><strong id="info_bonus_text"><%= bonus.text %></strong></td>
	</tr>
<% } /* end bonus */ %>
<% if (points) { %>
	<tr id="info_points_row">
		<td width="100px">Pontos:</td>
		<td id="info_points"><%= points %></td>
	</tr>
<% } /* end points */ %>
<% if (owner) { %>
	<tr id="info_owner_row">
		<td>Właściciel:</td>
		<td><%== '%name% (%points% Punktów)', owner %></td>
	</tr>
<% } else if (points == 0) { %>
	<tr id="info_left_row">
		<td colspan="2">Localização especial</td>
	</tr>
<% } else { %>
	<tr id="info_left_row">
		<td colspan="2">Abandonada</td>
	</tr>
<% } /* end owner */ %>

<% if (ally) { %>
	<tr id="info_ally_row">
		<td>Plemię:</td>
		<td><%== '%name% (%points% Punktów)', ally %></td>
	</tr>
<% } /* end ally */ %>
<% if (extra && extra.reservation && $('#map_popup_reservation').is(":checked")) { %>
	<tr><td>Reserva feita por:</td><td id="info_reserved_by"><%= extra.reservation.name %> [<%= extra.reservation.ally%>]</td></tr>
	<tr><td>A reserva expira:</td><td id="info_reserved_till"><%= extra.reservation.expires_at %></td></tr>
<% } %>
<% if (extra && extra.attack && $('#map_popup_attack').is(":checked")) { %>
	<tr>
		<td>Último ataque:</td>
		<td id="info_last_attack">
			<img src="/graphic/<%= TWMap.popup.attackDots[extra.attack.dot]%>" title="" alt="" class="" />
			<% if (extra.attack.dot != 4) { %>
				<img src="/graphic/<%= TWMap.popup.attackMaxLoot[extra.attack.max_loot]%>" title="" alt="" class="" />
			<% } %>

			<%= extra.attack.time %>
		</td>
	</tr>
<% } %>
<% if (extra && extra.attack_intel && $('#map_popup_attack_intel').is(":checked")) { %>
	<tr>
		<td>Últimos dados:</td>
		<td id="info_last_attack_intel">
			<img src="/graphic/<%= TWMap.popup.attackDots[extra.attack_intel.dot]%>" title="" alt="" class="" />
			<% if (extra.attack_intel.dot != 4) { %>
				<img src="/graphic/<%= TWMap.popup.attackMaxLoot[extra.attack_intel.max_loot]%>" title="" alt="" class="" />
			<% } %>

			<%= extra.attack_intel.time %>
			<% if (extra.attack_intel.start_player) { %>
				<%== 'od %start_player%', extra.attack_intel %>
			<% } %>
		</td>
	</tr>
<% } %>
<% if (extra && extra.morale && $('#map_popup_moral').is(":checked") && TWMap.morale) { %>
	<tr id="info_moral_row">
		<td>Moral:</td>
		<td id="info_moral"><%= Math.round(100 * extra.morale) %>%</td>
	</tr>
<% } %>
<% if (extra && extra.grocusto && extra.grocusto.length) { %>
	<tr id="info_village_grocusto_row">
		<td>Grupos:</td>
		<td id="info_village_grocusto"><%= extra.grocusto.join(', ') %></td>
	</tr>
<% } %>
<% if (extra && extra.flag && $('#map_popup_flag').is(":checked")) { %>
	<tr id="info_flag">
		<td>Bandeira:</td>
		<td id="info_village_flag"><img src="<%= extra.flag.image_path %>"></img> <%= extra.flag.short_desc %></td>
	</tr>
<% } %>
<% if (owner && owner.newbie_time) { %>
	<tr id="info_newbie_protect_row">
		<td colspan="2"><%== 'O alvo ainda tem proteção inicial.Só pode atacar %newbie_time%.', owner %></td>
	</tr>
<% } /* end newbie */ %>
<% if (extra && extra.resources && $('#map_popup_res').is(":checked")) { %>
	<tr>
		<td colspan="2">
			<table cellpadding="3" class="nowrap">
				<tr>
					<% if (extra.resources.wood) { %>
						<td><img src="/graphic/holz.png?a3702" title="" alt="" class="" /> <%= extra.resources.wood %></td>
					<% } %>
					<% if (extra.resources.stone) { %>
						<td><img src="/graphic/lehm.png?6c9bd" title="" alt="" class="" /> <%= extra.resources.stone %></td>
					<% } %>
					<% if (extra.resources.iron) { %>
						<td><img src="/graphic/eisen.png?0e9e5" title="" alt="" class="" /> <%= extra.resources.iron %></td>
					<% } %>
					<% if (extra.resources.max) { %>
						<td><img src="/graphic/res.png?0fdfc" title="" alt="" class="" /> <%= extra.resources.max %></td>
					<% } %>
				</tr>
			</table>
		</td>
	</tr>
<% } %>
<%
  var showPopulation = extra && extra.population && $('#map_popup_pop').is(":checked");
  var showTrader = extra && extra.trader && $('#map_popup_trader').is(":checked");
%>

<% if (showPopulation || showTrader) { %>
	<tr>
		<% if (showPopulation && showTrader) { %>
		<td>
		<% } else { %>
		<td colspan="2">
		<% } %>

		<% if (showPopulation) { %>
			<img src="/graphic/face.png?203fc" title="" alt="" class="" /> <%= extra.population.current %>/<%= extra.population.max %>
		<% } %>

		<% if (showPopulation && showTrader) { %> </td><td> <% } %>

		<% if (showTrader) { %>
			<img src="/graphic/overview/trader.png?4df99" title="" alt="" class="" /> <%= extra.trader.current %>/<%= extra.trader.total %>
		<% } %>
		</td>
	</tr>
<% } %>
<%
  var bg_colors = ['F8F4E8', 'DED3B9'];
  if (units.length > 0) {
%>
	<tr>
		<td colspan="2">
			<table style="border:1px solid #DED3B9" width="100%" cellpadding="0" cellspacing="0">
				<tr class="center">
					<% for (var i = 0; i < units.length; i++) { %>
					<td style="padding:2px;background-color:#<%= bg_colors[i%2] %>">
						<img src="/graphic/<%= units[i].image %>" title="" alt="" class="" />
					</td>
					<% } %>
				</tr>
				<% if (units_display.count) { %>
				<tr class="center">
