					<td style="padding:2px;background-color:#<%= bg_colors[i%2] %>">
						<%= units[i].count %>
					</td>
					<% } %>
				</tr>
				<% } /* end unit count */ %>
				<% if (units_display.time) { %>
				<tr class="center">
					<% for (var i = 0; i < units.length; i++) { %>
					<td style="padding:2px;background-color:#<%= bg_colors[i%2] %>">
						<%= units[i].time %>
					</td>
					<% } %>
				</tr>
				<% } /* end unit times */ %>

			</table>
		</td>
	</tr>
<%
  } /* end units */
%>
<% if (extra && extra.notes && $('#map_popup_notes').is(':checked')) { %>
	<tr>
		<td colspan="2"><hr /><u>Notas:</u><%= extra.notes %></td>
	</tr>
<% } /* end notes */ %>
<% if (extra === false) { %>
	<tr>
		<td colspan="2"><table><tr><td><img src="/graphic/throbber.gif?3286b" title="" alt="" class="" /></td><td>Informações sobre carregamento...</td></tr></table></td>
	</tr>
<% } %>

<% } %>

</table>
</script>
